(5662, 54, '_page-tech_0_ttl', 'field_6539b1ab48eb7'),
(5663, 54, 'page-tech_0_txt', 'L’empreinte optique numérique est une technologie de pointe qui permet l’obtention d’image en direct d’une ou de plusieurs dents en trois dimensions et à l’aide d’une caméra intra-buccale couplée à un ordinateur.'),
