(5668, 54, '_page-tech_1_ttl', 'field_6539b1ab48eb7'),
(5669, 54, 'page-tech_1_txt', 'La radio Panoramique est une technologie permettant l’exploration précise des structures osseuses et dentaires en trois dimensions. Une technologie essentielle dans l’élaboration d’un plan de traitement et pour le suivi de chaque patient.'),
