(28, 1, '2023-10-18 17:56:23', '2023-10-18 15:56:23', '<h2>Chirurgien-dentiste</h2>\n<h3><span style=\"color: #6a90ba;\">Diplômes nationaux et universitaires :</span></h3>\n<p> </p>\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td>2021</td><td>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</td></tr><tr><td>2020</td><td>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</td></tr><tr><td>2014</td><td>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</td></tr><tr><td>2012</td><td>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</td></tr></tbody></table></figure>\n<!-- /wp:table -->\n\n<p>Après une première année de médecine à Poitiers, je choisis la faculté de Nantes pour y effectuer des études d’odontologie.<br />En 2017 après avoir soutenu la thèse d’état de chirurgien-dentiste sur le thème du traitement de la classe II squelettique à l’aide du Propulseur Universel Light, concept et illustration clinique j’intègre l’Ecole Supérieure d’Orthodontie à Paris pour 3 ans d’étude afin d’acquérir les connaissances fondamentales de cette spécialité.<br /><br />En parallèle début 2018 j’ai la chance de débuter une collaboration qui se concrétise par une association avec le Docteur Elie Callabe spécialiste qualifié en Orthopédie-dento-faciale et inventeur du PUL (Propulseur Universel Light). A ces côtés pendant 4 ans et demi j’effectue un véritable compagnonnage qui me permet de me nourrir de sa pratique technique mais également et surtout de bénéficier de son expérience clinique de plus de 30 ans d’exercice de l’orthodontie médicale.<br /><br />En 2021, admission au cursus de 3 ans à l’Université de la Sorbonne (Paris Hôpital de la Pitié Salpêtrière) en vue d’obtenir le Diplôme Universitaire en Orthopédie Dento-Cranio-Maxillo-Faciale.<br /><br />En novembre 2022, ouverture du cabinet Plaisir de sourire à Aiffres.<br />Membre de la Société Française d’Orthopédie Dento-Faciale (SFODF) ainsi que de la Société Bioprogressive de Ricketts (SBR).</p>', 'Dr Guillaume Arbouin', '', 'publish', 'closed', 'closed', '', 'dr-guillaume-arbouin', '', '', '2023-10-26 08:57:00', '2023-10-26 06:57:00', '', 0, 'http://plaisir-de-sourire.sam/?page_id=28', 0, 'page', '', 0),
