(91, 1, '2023-10-20 11:31:50', '2023-10-20 09:31:50', '<h2 style=\"text-align: center;\">Les gouttières invisibles</h2>\n<h3 style=\"text-align: center;\"><span style=\"color: #6a90ba;\">Qu’est-ce que c’est ?</span></h3>\nLa technique des « gouttières invisibles » est une technique d’orthodontie invisible qui fait ses preuves depuis de nombreuses années. Des gouttières transparentes et amovibles thermoplastiques ou aligneurs sont utilisés afin de pouvoir aligner vos dents de façon discrète et sans aucune gêne contrairement aux techniques d’orthodonties par bagues. Cette méthode sur-mesure a gagné en popularité au cours de ces dernières années, en particulier chez les adultes recherchant un traitement discret.\n\n<img class=\"aligncenter wp-image-227 size-full\" src=\"http://plaisir-de-sourire.sam/wp-content/uploads/2023/10/Rectangle-1176.png\" alt=\"\" width=\"1028\" height=\"540\" />\n<h3 style=\"text-align: center;\"><span style=\"color: #6a90ba;\">Comment se déroule le traitement ?</span></h3>\n<h4 style=\"text-align: center;\">Etape 1 : Nous prenons votre empreinte</h4>\n<ul>\n 	<li>L’orthodontiste a besoin de recueillir l’ensemble des éléments nécessaires à l’élaboration de votre traitement. Lors de votre premier rendez-vous, il prendra des photos de votre dentition, fera des radiographies et des empreintes.</li>\n 	<li>Les empreintes étaient auparavant réalisées grâce à une pâte que l’on plaçait dans des portes empreintes pour réaliser un moule. Aujourd’hui, grâce aux dernières innovations, vos empreintes seront réalisées grâce à une caméra d’empreinte optique numérique.</li>\n</ul>\n<h4 style=\"text-align: center;\">Etape 2 : Recevez vos aligneurs</h4>\n<ul>\n 	<li>Suite au bilan complet effectué lors du 1er rendez-vous, votre orthodontiste réalisera une simulation des déplacements dentaires jusqu’au résultat final. Un nombre de gouttières ainsi que la durée de votre traitement sera prédéfini à l’avance. Vous pourrez visualiser à l’avance votre futur sourire !</li>\n 	<li>Suite au bilan complet effectué lors du 1er rendez-vous, votre orthodontiste réalisera une simulation des déplacements dentaires jusqu’au résultat final. Un nombre de gouttières ainsi que la durée de votre traitement sera prédéfini à l’avance. Vous pourrez visualiser à l’avance votre futur sourire !</li>\n 	<li>Lorsque celles-ci sont prêtes, vous pouvez immédiatement commencer à les porter. Il est nécessaire de les garder 22 heures sur 24. Vous porterez chacune de vos gouttières pendant deux semaines, ne les enlevant que pour manger et vous brosser les dents.</li>\n 	<li>La durée moyenne d’un traitement peut varier entre 6 à 12 mois selon la progression de l’alignement des dents. Vous êtes autonome durant ce processus, les rendez-vous avec le praticien ont lieu généralement tous les trois ou quatre mois.</li>\n</ul>\n<h3 style=\"text-align: center;\"><span style=\"color: #6a90ba;\">Prêt(e) à commencer ?</span></h3>\nPrenez rendez-vous avec votre praticien. Votre futur sourire est à portée de clic !', 'Traitement préventif', '', 'publish', 'open', 'closed', '', 'traitement-preventif', '', '', '2023-10-26 02:01:44', '2023-10-26 00:01:44', '', 0, 'http://plaisir-de-sourire.sam/?post_type=traitements&#038;p=91', 0, 'traitements', '', 0),
