(194, 1, '2023-10-25 12:09:40', '2023-10-25 10:09:40', '<div class=\"row\">\r\n	<div class=\"col-12 col-lg-6\">\r\n		<div class=\"form-item form-txt\">\r\n			<label>\r\n			    [text* your-name autocomplete:name] \r\n			    <span class=\"float-lbl\">Nom *</span>\r\n			</label>\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12 col-lg-6\">\r\n		<div class=\"form-item form-txt\">\r\n			<label>\r\n			    [text* your-surname autocomplete:name] \r\n			    <span class=\"float-lbl\">Prénom *</span>\r\n			</label>\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12 col-lg-6\">\r\n		<div class=\"form-item form-txt\">\r\n			<label>\r\n			    [tel* your-phone autocomplete:phone]\r\n			    <span class=\"float-lbl\">Téléphone *</span>\r\n			</label>\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12 col-lg-6\">\r\n		<div class=\"form-item form-txt\">\r\n			<label>\r\n			    [email* your-email autocomplete:email]\r\n			    <span class=\"float-lbl\">Email *</span>\r\n			</label>\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12 col-lg-6 main-contact_form-item-tratement\">\r\n		<div class=\"form-radio-lbl\">Traitement pour:</div>\r\n			<div class=\"form-item form-radio\">\r\n				[radio your-traitement use_label_element default:1 \"Moi\" \"Mon enfant\"]\r\n			</div>\r\n			<div class=\"form-item form-txt\">\r\n				[group traitement-required]\r\n						<label>\r\n							[number* your-age-req min:0]\r\n							<span class=\"float-lbl\">Age *</span>\r\n						</label>\r\n				[/group]\r\n				[group traitement-not-required]\r\n						<label>\r\n							[number your-age min:0]\r\n							<span class=\"float-lbl\">Age</span>\r\n						</label>\r\n				[/group]\r\n			</div>\r\n	</div>\r\n	<div class=\"col-12 col-lg-6\">\r\n		<div class=\"form-radio-lbl\">Êtes-vous en cours de traitement?</div>\r\n		<div class=\"form-item form-radio\">\r\n			[radio your-vous use_label_element default:1 \"Oui\" \"Non\"]\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12\">\r\n		<div class=\"form-item form-txt\">\r\n			<label>\r\n				[textarea your-message]\r\n			    	<span class=\"float-lbl\">Message</span>\r\n			</label>\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12\">\r\n		<div class=\"form-submit\">\r\n			[submit class:btn \"Submit\"]\r\n		</div>\r\n	</div>\r\n</div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <info@plaisir-de-sourire.sam>\n[_site_admin_email]\nFrom: [your-name] [your-email]\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis is a notification that a contact form was submitted on your website ([_site_title] [_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <info@plaisir-de-sourire.sam>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis email is a receipt for your contact form submission on our website ([_site_title] [_site_url]) in which your email address was used. If that was not you, please ignore this message.\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nPlease fill out this field.\nThis field has a too long input.\nThis field has a too short input.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe uploaded file is too large.\nThere was an error uploading the file.\nPlease enter a date in YYYY-MM-DD format.\nThis field has a too early date.\nThis field has a too late date.\nPlease enter a number.\nThis field has a too small number.\nThis field has a too large number.\nThe answer to the quiz is incorrect.\nPlease enter an email address.\nPlease enter a URL.\nPlease enter a telephone number.', 'Contact form', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2023-10-26 16:58:10', '2023-10-26 14:58:10', '', 0, 'http://plaisir-de-sourire.sam/?post_type=wpcf7_contact_form&#038;p=194', 0, 'wpcf7_contact_form', '', 0),
