(4, 4, 'traitement', 'La haute autorité de Santé (HAS) recommande un examen de dépistage orthodontique dès l’âge de 6 ans, au moment ou l’enfant présente une denture mixte (présence de dents temporaires (dents de lait) et de certaines dents définitives de façon concomitantes dans la cavité buccale). Dès cet âge, certains enfants peuvent présenter des problèmes orthodontiques : une mâchoire supérieure trop étroite, un menton trop en arrière ou trop en avant, un recouvrement excessif des incisives inférieures par les incisives supérieures, des problèmes d’éruption dentaire liés à un manque de place sur l’arcade… autant de signes qui doivent vous alerter pour consulter un orthodontiste.\r\n\r\nL’objectif principal de cette prise en charge orthodontique précoce, aussi appelée phase d’interception, est d’intercepter un problème avant qu’il ne s’aggrave. Il convient de corriger le décalage des mâchoires, de modifier la position des dents, d’aménager la place nécessaire à l’éruption des dents définitives et d’accompagner l’apprentissage des fonctions de mastication, déglutition et ventilation.\r\nCes traitements permettent ainsi de rétablir un environnement anatomique et fonctionnel équilibré, garants d’une croissance oro-faciale harmonieuse de l’enfant.', 0, 4),
